@EU_Commission @Bundeskanzler @OlafScholz Sehr geehrter Herr Bundeskanzler,
Ich bin nicht für den Krieg.  Ich verabscheue Krieg, aber der Ukraine nicht mit Waffen zu helfen, die auch funktionieren ist beschämend. Warum verschanzen wir uns hinter der Bürokratie, wegen der armen Industrie? 
Leiden wir am Storchensyndrom?

@EU_Commission @Bundeskanzler @OlafScholz Show your actions Not just talks!
Look at these innocent n brave Ukraine children, all hypocrisy n diplomacy crush in front of them!!
Defending Ukraine is Defending the hope of us!!!

@EU_Commission @Bundeskanzler @OlafScholz with this kind of enemy can't be negotiated, but only be forcefully dealt with. 
what they acted out is modern day precariatization, a subtype of  nihilism.
NATO must solve the problem, when Germany &amp; Austria prefer to support Putin's war machine with gas EUR.
